import React from "react"

class TabItem extends React.Component{
  render() {
    return (
      <div>
        <li className="nav-item">
          <a className={this.props.className} href={this.props.url} data-toggle={this.props.toggle}>
            {this.props.title}
          </a>
        </li>
      </div>
    )
  }
}
export default TabItem
